styles:
:host {
    display: flex;
    width: 100%;
    height: 5px;
    pointer-events: none;
    position: absolute;
}

:host .background {
    background-color: white;
}

vg-controls :host {
    position: absolute;
    top: calc(50% - 3px);
    -webkit-border-radius: 2px;
    -moz-border-radius: 2px;
    border-radius: 2px;
}

vg-controls :host .background {
    border: 1px solid white;
    -webkit-border-radius: 2px;
    -moz-border-radius: 2px;
    border-radius: 2px;
}
